console.log(todos)

class App extends React.Component{

  constructor(){
    super();
    this.state = {
      title : "aplicacion de tareas",
      ntareas : "10000"
    }
  }



  render(){
    return(
      <div className="App">

        <div>
          <Nav inf={this.state.title} n={this.state.ntareas}/>
        </div>

        <div className="col-4">
        <img src={logo} className="App-logo" alt="logo" />
        <Form/>
        </div>

        <div className="col-8">

        </div>

    </div>
    )
  }
}



export default App;
